Step-by-step reasoning:
1. Key psychological mechanisms include sensitivity to fairness and concern for absolute monetary gain. For a responder, acceptance is driven by comparing the proposed split (split_self) to what is considered fair given the token contributions (token_self and token_opp) and the combined earning. If the proposal is better than the fair share, acceptance is more likely.
2. The mechanisms interact in such a way that the responder weighs both the deviation from a fairness benchmark and the absolute gain. Thus, two components affect the decision: one indexing fairness deviation and one indexing self‐gain.
3. A mathematically simple way to capture these interactions is to compute the fair share as the proportion of tokens earned by the participant multiplied by the combined earning. The fairness deviation is the difference between the offered split (split_self) and this fair share. Linearly combining fairness deviation and the absolute proposed amount, plus a bias, produces an overall utility.
4. The model then uses the logistic transformation of the utility to yield a probability of acceptance. Learnable parameters include an intercept (beta_0), a weight on fairness deviation (beta_fair) and a weight on the absolute amount (beta_self).
5. The model variables map to observable behavior as follows: the data provides the proposed amount (split_self), tokens (token_self and token_opp) and the combined earning to compute an expected fair amount. These inputs feed into the utility function that, through a sigmoidal link, predicts the binary accept/reject decision (target variable “accept”).

<MODEL>
U_i = beta_0 + beta_fair * (split_self_i - (combined_earning_i * (token_self_i/(token_self_i+token_opp_i)))) + beta_self * split_self_i
P(accept_i = 1) = 1/(1+exp(-U_i))
</MODEL>

